const MIN_WIDTH = 800

function onError(error) {
  console.log(`Error: ${error}`);
}

function raiseAlert(tabId, message, popup) {
    console.log("ww")
    browser.pageAction.show(tabId)
    if (popup)
        browser.tabs.sendMessage(
            tabId,
            {alert: message}
        ).catch(onError)
}

function checkHomography(tabId, domainName, popup) {
    console.log("homo")
    domainName = domainName.split('.').length > 2 ? domainName.split('.')[1] : domainName.split('.')[0]
    var resolvedDomainName = punycode.toUnicode(domainName)
    if (domainName != resolvedDomainName)
    {
        var homoglyphsCount = 0
        for (var i = 0; i < resolvedDomainName.length; i++) {
            if (resolvedDomainName[i] in homoglyphs)
                homoglyphsCount++
            else
                break
        }
        if (homoglyphsCount == resolvedDomainName.length)
            raiseAlert(tabId, "PhishingBlocker Warning: This site only uses exotic characters that are similar to letters in the Latin alphabet. This is probably an attempt to impersonate another site for phishing purposes. We advise you to close this tab.", popup)
    }
}

function evaluateWindowsCharacteristics(windows, tabId, trueDomainName, falseDomainName, popup) {
    if (windows.type in ["popup", "panel"] || windows.width < MIN_WIDTH)
        raiseAlert(tabId, "PhishingBlocker Warning: this site domain name is " + trueDomainName + " not " + falseDomainName, popup)
}

function checkMask(tabId, domainName, popup) {
    var domainName = domainName.replace(/http.?:\/\//, '').split('/', 1)[0]
    if (domainName.split('.').length > 4)
    {
        var length = domainName.split('.').length
        var trueDomainName = domainName.split('.')[length-2] + "." + domainName.split('.')[length-1]
        var falseDomainName = domainName.split('.')[0] + "." + domainName.split('.')[1] + "." + domainName.split('.')[2]
        browser.tabs.get(tabId).then(tab => browser.windows.get(tab.windowId)).then(windows => evaluateWindowsCharacteristics(windows, tabId, trueDomainName, falseDomainName, popup)).catch(onError)
    }
}

function applyChecks(domainName, tabId, item) {
    var popup = domainName in item && item[domainName] ? false : true
    checkHomography(tabId, domainName, popup)
    checkMask(tabId, domainName, popup)
}

function checkTab(tabId, changeInfo, tab) {
    if (tab.url && changeInfo.status == "complete")
    {
        var domainName = tab.url.replace(/http.?:\/\//, '').split('/', 1)[0]
        browser.storage.local.get(domainName).then(applyChecks.bind(null, domainName, tabId), onError)

    }
}

browser.tabs.onUpdated.addListener(checkTab, {properties: ["status"]})